script: |
  super -f text -I q4608.spq | sort > q4608.out

inputs:
  - name: q4608.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN col0 * - col0 - - - col0 * - col2 - col2 - - - col1 * - + col2 * - col0 * col0 AND + + col0;
  - name: tab2

outputs:
  - name: q4608.out
    data: |
      46	51	23
      64	77	40
